        "title": "the best of: Ewan McGregor",
        "description": "if you like my videos, buy me a coffee :) https://ko-fi.com/agronsky\n\n#birdsofprey #starwars #ewanmcgregor\n\n\nEwan Gordon McGregor OBE (born 31 March 1971[1]) is a Scottish actor known internationally for his various film roles, including independent dramas, science-fiction epics, and musicals.\n\nMcGregor's first professional role was in 1993, when he won a leading role in the British Channel 4 series Lipstick on Your Collar.[2] Some of his best known roles include heroin addict Mark Renton in the drama films Trainspotting (1996) and T2 Trainspotting (2017), Obi-Wan Kenobi in the Star Wars prequel trilogy (1999‚Äì2005), poet Christian in the musical film Moulin Rouge! (2001), young Edward Bloom in Big Fish (2003), Rodney Copperbottom in Robots (2005), Camerlengo Father Patrick McKenna in Angels and Demons (2009), \"the ghost\" in Roman Polanski's political thriller The Ghost Writer (2010), Dr. Alfred Jones in the romantic comedy-drama Salmon Fishing in the Yemen (2011), Lumi√®re in the live-action adaptation of the musical romantic fantasy Beauty and the Beast (2017), the adult version of the titular character in the fantasy comedy-drama Christopher Robin (2018) and the adult version of Dan Torrance in the horror film Doctor Sleep (2019). He appeared as DC Comics villain Black Mask in the superhero film Birds of Prey (2020).\n\nIn 2018, McGregor won a Golden Globe Award for Best Actor ‚Äì Miniseries or Television Film for his performance as brothers in the third season of FX anthology series Fargo, and received Golden Globe nominations for Best Actor ‚Äì Musical or Comedy for both Moulin Rouge! and Salmon Fishing in the Yemen. McGregor has also starred in theatre productions of Guys and Dolls (2005‚Äì07) and Othello (2007‚Äì08). He was ranked number 36 on Empire magazine's \"The Top 100 Movie Stars of All Time\" list in 1997.[3] In a 2004 poll for the BBC, McGregor was named the fourth most influential person in British culture.[4][5]\n\nMcGregor has been involved in charity work and has served as an ambassador for UNICEF UK since 2004. In 2013, he was appointed an Officer of the Order of the British Empire (OBE) for services to drama and charity. In 2016, he received the BAFTA Britannia Humanitarian Award.[6]",
